import React from "react";

/* import { NavLink } from "react-router-dom"; */

const Comments = ({comment}) => {
  const { date, body } = comment;

  return (
    <div className="container">
        <p>{date}</p>
        <div>
            <p>
                {body}
            </p>
        </div>
    </div>
  );
};

export default Comments;
